import java.io._
import org.apache.tez.history.parser._
import org.apache.tez.analyzer.plugins._
import org.apache.tez.analyzer.utils._
import org.apache.hadoop.conf.Configuration

//e.g /grid/4/home/rajesh/dag_1437098194051_0181_4.zip
var dagFile = z.input("dagFile")
//e.g dag_1437098194051_0181_4
var dagName = z.input("dagName")
//e.g /tmp/
var tmpDir = z.input("tmpDir")

var atsParser = new ATSFileParser(new File(dagFile.toString()));
var dagInfo = atsParser.getDAGData(dagName.toString());

/**
 * Critical Path (vertex level) analyzer
 */
var config = new Configuration()
config.set("tez.critical-path.analyzer.dot.output.loc", "/var/www/html/rajesh/")
var criticalPathAnalyzer = new CriticalPathAnalyzer(config)
criticalPathAnalyzer.analyze(dagInfo)
var criticalPathAnalyzerrResult = criticalPathAnalyzer.getResult
case class CriticalPath(CriticalPath:String, Score:String)

/**
 *  Ideally should be able to parse getResult (Iterator<String[]>).  Instead this is a dirty hack of dumping it to CSV and reloading.
 */
var result = criticalPathAnalyzerrResult.dumpToFile(tmpDir.toString() + "/criticalPath_" + dagName.toString() + ".csv")
val criticalPathAnalyzerText= sc.textFile("file://" + tmpDir.toString() + "/criticalPath_" + dagName.toString() + ".csv")

val cpResult = criticalPathAnalyzerText.map(s=>s.split(",")).filter(s=>(s.length == 2)).map(
    s=>CriticalPath(s(0),s(1)
        )
)
cpResult.toDF().registerTempTable("criticalPath_" + dagName.toString())


/**
 * Shuffle time analyzer
 */
config = new Configuration()
config.set("tez.shuffle-time-analyzer.real-work.done.ratio","0.4") /* Ratio of (total time - shuffle time) / (total time).*/
config.set("tez.shuffle-time-analyzer.shuffle.min.records","100") /*Filtering: num of min records that needs to be available as reduce input records*/
var shuffleTimeAnalyzer = new ShuffleTimeAnalyzer(config)
shuffleTimeAnalyzer.analyze(dagInfo)
var shuffleTimeAnalyzerResult = shuffleTimeAnalyzer.getResult

var result = shuffleTimeAnalyzerResult.dumpToFile(tmpDir.toString() + "/shuffleTimeAnalyzer_" + dagName.toString() + ".csv")
val shuffleAnalyzerText = sc.textFile("file://" + tmpDir.toString() + "/shuffleTimeAnalyzer_" + dagName.toString() + ".csv")

case class Shuffle(vertexName:String, taskAttemptId:String, Node:String, counterGroup:String, Comments:String, REDUCE_INPUT_GROUPS:String, REDUCE_INPUT_RECORDS:String, ratio:String, SHUFFLE_BYTES:String, TotalTimeTaken:String, TimeTaken_To_Receive_Events:String, MERGE_PHASE_TIME:String, SHUFFLE_PHASE_TIME:String, TimeTaken_For_Real_Task:String, FIRST_EVENT_RECEIVED:String, LAST_EVENT_RECEIVED:String, SHUFFLE_BYTES_DISK_DIRECT:String)

val shuffleResult = shuffleAnalyzerText.map(s=>s.split(",")).filter(s=>(s.length == 17)).map(
    s=>Shuffle(s(0),s(1),s(2),s(3),s(4),s(5),s(6),s(7),s(8),
            s(9),s(10),s(11),s(12),s(13),s(14),s(15),s(16)
        )
)

shuffleResult.toDF().registerTempTable("shuffleResult_" + dagName.toString())


/**
 * Skew Analyzer. Analyze whether there are any data skew in the vertices due to which it could be slow.
 * 
 * 1. (RECORD_INPUT_GROUPS / REDUCE_INPUT_RECORDS) < 0.2 && SHUFFLE_BYTES > threshold
 *          - This means couple of keys having too many records. Either partitioning is wrong, or increase mem-limit
 * 
 * 2. (RECORD_INPUT_GROUPS / REDUCE_INPUT_RECORDS) > 0.6 && Number of reduce input records in task attempt is closer to say 60% of overall number of records
 *          in vertex level & numTasks in vertex is greater than 1. 
 *          - This means that, partitioning is wrong (can also consider reducing number of tasks)
 * 
 * 3. (RECORD_INPUT_GROUPS / REDUCE_INPUT_RECORDS) is between min/max (i.e 0.2 and 0.6) & numTasks is greater than 1 & SHUFFLE_BYTES > threshold per task attempt from a source. 
 *          - This means, may be consider increasing parallelism based on the task attempt runtime.
 * 
 */
config = new Configuration()
/* Setting it to low value for demo purpose. Min threshold: amount of bytes that is sent as SHUFFLE_BYTES from source.*/
config.set("tez.skew-analyzer.shuffle.bytes.per.source","100000") 

config.set("tez.skew-analyzer.shuffle.key.group.min.ratio","0.2") /*Filtering: Min reducer input group : reducer keys ratio for computation*/
config.set("tez.skew-analyzer.shuffle.key.group.max.ratio","0.6") /*Filtering: Max reducer input group : reducer keys ratio for computation*/
var skewAnalyzer = new SkewAnalyzer(config)
skewAnalyzer.analyze(dagInfo)
var skewAnalyzerResult = skewAnalyzer.getResult

var result = skewAnalyzerResult.dumpToFile(tmpDir.toString() + "/skewAnalyzer_" + dagName.toString() + ".csv")
val skewAnalyzerResultText = sc.textFile("file://" + tmpDir.toString() + "/skewAnalyzer_" + dagName.toString() + ".csv")

case class Skew(vertexName:String, taskAttemptId:String, counterGroup:String, node:String,
      REDUCE_INPUT_GROUPS:String, REDUCE_INPUT_RECORDS:String, input_records_to_group_ratio:String, SHUFFLE_BYTES:String, timeTaken:String,
      observation:String)

val sResult = skewAnalyzerResultText.map(s=>s.split(",")).filter(s=>(s.length == 10)).map(
    s=>Skew(s(0),s(1),s(2),s(3),s(4),s(5),s(6),s(7),s(8),s(9))
)

sResult.toDF().registerTempTable("skewAnalyzer_" + dagName.toString()) 

/**
 * Slow vertex analyzer (provide percentile details)
 */
config = new Configuration()
config.setLong("tez.slowest-vertex-analyzer.max.vertex.runtime", 50000) /* For demo. Anything > 50 seconds is considered slow */
var slowestVertexAnalyzer = new SlowestVertexAnalyzer(config)
slowestVertexAnalyzer.analyze(dagInfo)
var slowestVertexAnalyzerResult = slowestVertexAnalyzer.getResult

var result = slowestVertexAnalyzerResult.dumpToFile(tmpDir.toString() + "/slowestVertexAnalyzer_" + dagName.toString() + ".csv")
val slowestVertexAnalyzerText = sc.textFile("file://" + tmpDir.toString() + "/slowestVertexAnalyzer_" + dagName.toString() + ".csv")

/**
 *  Define SlowestVertex class and load the results as DataFrame
 * 
 */
case class SlowestVertex(vertexName:String, taskAttempts:String, totalTime:String,
      shuffleTime:String, shuffleTime_Max:String, LastEventReceived:String, LastEventReceivedFrom:String,
     percentile_75:String, percentile95:String, percentile_98:String, Median:String,
      observation:String, comments:String)

val svResult = slowestVertexAnalyzerText.map(s=>s.split(",")).filter(s=>(s.length == 13)).map(
    s=>SlowestVertex(s(0),s(1),s(2),s(3),s(4),s(5),s(6),s(7),s(8),s(9),s(10),s(11),s(12)
        )
)

svResult.toDF().registerTempTable("slowestVertex_" + dagName.toString())

/**
 * SlowTaskIdentifier analyzer.
 */
config = new Configuration()
config.set("tez.slow-task-analyzer.task.count", "500000") //how many tasks to pull
var slowTaskIdentifier = new SlowTaskIdentifier(config)
slowTaskIdentifier.analyze(dagInfo)
var slowTaskIdentifierResult = slowTaskIdentifier.getResult
var result = slowTaskIdentifierResult.dumpToFile(tmpDir.toString() + "/slowTasks_" + dagName.toString() + ".csv")
val slowTaskIdentifierText =  sc.textFile("file://" + tmpDir.toString() + "/slowTasks_" + dagName.toString() + ".csv")

/**
 *  Define SlowTask class and load the results as DataFrame
 * 
 */
case class SlowTask(vertexName:String, taskAttemptId:String, Node:String,
      taskDuration:String, Status:String, diagnostics:String, NoOfInputs:String)

val stResult = slowTaskIdentifierText.map(s=>s.split(",")).filter(s=>(s.length == 7)).map(
    s=>SlowTask(s(0),s(1),s(2),s(3),s(4),s(5),s(6)
        )
)

stResult.toDF().registerTempTable("slowTask_" + dagName.toString()) 

/**
 * SpillAnalyzer. Check if any spills happened in tasks
 */
config = new Configuration()
config.set("tez.spill-analyzer.min.output.bytes.threshold", "50000") //min amount of bytes that needs to be churned out by a task.
var spillAnalyzer = new SpillAnalyzerImpl(config)
spillAnalyzer.analyze(dagInfo)
var spillAnalyzerResult = spillAnalyzer.getResult
var result = spillAnalyzerResult.dumpToFile(tmpDir.toString() + "/spills_" + dagName.toString() + ".csv")
val spillAnalyzerText =  sc.textFile("file://" + tmpDir.toString() + "/spills_" + dagName.toString() + ".csv")

/**
 *  Define Spill class and load the results as DataFrame
 * 
 */
case class Spill(vertexName:String, taskAttemptId:String, Node:String,
      counterGroupName:String, spillCount:String, taskDuration:String,
      OUTPUT_BYTES:String, OUTPUT_RECORDS:String, SPILLED_RECORDS:String, 
      Recommendation:String
      )

val spillResult = spillAnalyzerText.map(s=>s.split(",")).filter(s=>(s.length == 10)).map(
    s=>Spill(s(0),s(1),s(2),s(3),s(4),s(5),s(6),s(7),s(8),s(9)
        )
)

spillResult.toDF().registerTempTable("spills_" + dagName.toString())


/**
 * SlowNodeAnalyzer. Check if any slow nodes are available. Need to do some comparisons relative to other nodes
 */
var slowNodeAnalyzer = new SlowNodeAnalyzer(new Configuration())
slowNodeAnalyzer.analyze(dagInfo)
var slowNodeAnalyzerResult = slowNodeAnalyzer.getResult
var result = slowNodeAnalyzerResult.dumpToFile(tmpDir.toString() + "/slowNodes_" + dagName.toString() + ".csv")
val slowNodeAnalyzerText = sc.textFile("file://" + tmpDir.toString() + "/slowNodes_" + dagName.toString() + ".csv")

/**
 *  Define SlowNode class and load the results as DataFrame
 * 
 */
case class SlowNode(nodeName:String, noOfTasksExecuted:String, noOfKilledTasks:String,
      noOfFailedTasks:String, avgSucceededTaskExecutionTime:String, avgKilledTaskExecutionTime:String,
      avgFailedTaskExecutionTime:String, avgHDFSBytesRead:String, avgHDFSBytesWritten:String,
      avgFileBytesRead:String, avgFileBytesWritten:String, avgGCTimeMillis:String, avgCPUTimeMillis:String
      )

val slowNodeResult = slowNodeAnalyzerText.map(s=>s.split(",")).filter(s=>(s.length == 13)).map(
    s=>SlowNode(s(0),s(1),s(2),s(3),s(4),s(5),s(6),s(7),s(8),s(9),s(10),s(11),s(12)
        )
)

slowNodeResult.toDF().registerTempTable("slowNodes_" + dagName.toString())


/**
 * TaskConcurrency Analyzer - Analyze how the vertices got slots and visualize if there were any starvation
 */
var config = new Configuration()
config.setInt("tez.task-concurrency-analyzer.time.interval", 5000)
var taskConcurrencyAnalyzer = new TaskConcurrencyAnalyzer(config)
taskConcurrencyAnalyzer.analyze(dagInfo)
var taskConcurrencyAnalyzerResult = taskConcurrencyAnalyzer.getResult
var result = taskConcurrencyAnalyzerResult.dumpToFile(tmpDir.toString() + "/taskConcurrencyAnalyzer_" + dagName.toString() + ".csv")
val taskConcurrencyAnalyzerText =  sc.textFile("file://" + tmpDir.toString() + "/taskConcurrencyAnalyzer_" + dagName.toString() + ".csv")

/**
 *  Define TaskConcurrency class and load the results as DataFrame
 * 
 */
case class TaskConcurrency(time:String, vertexName:String, concurrentTasksRunning:String)

val tcResult = taskConcurrencyAnalyzerText.map(s=>s.split(",")).filter(s=>(s.length == 3)).map(
    s=>TaskConcurrency(s(0),s(1),s(2))
)

tcResult.toDF().registerTempTable("taskConcurrencyAnalyzer_" + dagName.toString())

/**
 * try swimlane view?. Note that this is a hack to dump SVG into hardcoded path and serve it via apache. 
 */
var svgUtils = new SVGUtils(dagInfo)
svgUtils.saveAsSVG("/var/www/html/rajesh/" + dagName.toString() + ".svg");



/**
 * Container Reuse Analyzer
 */
var containerReuseAnalyzer = new ContainerReuseAnalyzer(new Configuration())
containerReuseAnalyzer.analyze(dagInfo)
var containerReuseAnalyzerResult = containerReuseAnalyzer.getResult
var result = containerReuseAnalyzerResult.dumpToFile(tmpDir.toString() + "/containerReuseAnalyzer_" + dagName.toString() + ".csv")
val containerReuseAnalyzerText = sc.textFile("file://" + tmpDir.toString() + "/containerReuseAnalyzer_" + dagName.toString() + ".csv")

/**
 *  Define ConatinerResult class and load the results as DataFrame
 * 
 */
case class ContainerReuse(vertexName:String, taskAttempts:String, node:String, containerId:String, reuseCount:String)

val containerReuseResult = containerReuseAnalyzerText.map(s=>s.split(",")).filter(s=>(s.length == 5)).map(
    s=>ContainerReuse(s(0),s(1),s(2),s(3),s(4)
        )
)

containerReuseResult.toDF().registerTempTable("containerReuse_" + dagName.toString())


/**
 * LocalityAnalyzer - For understanding data local issues
 */

var localityAnalyzer = new LocalityAnalyzer(new Configuration())
localityAnalyzer.analyze(dagInfo)
var localityAnalyzerResult = localityAnalyzer.getResult
var result = localityAnalyzerResult.dumpToFile("/tmp/localityAnalyzer_" + dagName.toString() + ".csv")
val localityAnalyzerText = sc.textFile("file:///tmp/localityAnalyzer_" + dagName.toString() + ".csv")

/**
 *  Define localityResult class and load the results as DataFrame
 * 
 */
case class Locality(vertexName:String, numTasks:String, dataLocalRatio:String, rackLocalRatio:String,
      otherRatio:String, avgDataLocalTaskRuntime:String, avgRackLocalTaskRuntime:String,
      avgOtherLocalTaskRuntime:String, noOfInputs:String, avgHDFSBytesRead_DataLocal:String,
      avgHDFSBytesRead_RackLocal:String, avgHDFSBytesRead_Others:String, recommendation:String)

val localityResult = localityAnalyzerText.map(s=>s.split(",")).filter(s=>(s.length == 13)).map(
    s=>Locality(s(0),s(1),s(2),s(3),s(4),s(5),s(6),s(7),s(8),
            s(9),s(10),s(11),s(12)
        )
)

localityResult.toDF().registerTempTable("localityResult_" + dagName.toString())

%sql SELECT *
FROM slowestVertex__${dagName}
ORDER BY cast(totalTime AS int) DESC

%sql SELECT *
FROM localityResult__${dagName}
ORDER BY numTasks DESC
